const Header = () => {
  return (
    <>
      <header className="">
        <div>
          <figure>
            <img src="/bambo-logo.png" alt="bambo-logo" />
          </figure>
          <h1>Bambo</h1>
          <p>Colombia / Barranquilla</p>
        </div>

        <nav>
          <ul>
          <li><i className="mdi mdi-instagram"></i></li>
          <li><i className="mdi mdi-twitter"></i></li>
          <li><i className="mdi mdi-facebook"></i></li>
          </ul>
        </nav>
      </header>
    </>
  );
};

export default Header;
